// Employees.js

import React, { useEffect } from "react";
import { connect } from "react-redux";
import { getEmployees } from "./actions";

function UserList() {
  const [employeeId, setemployeeId] = useState("");
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [birthday, setBirthday] = useState("");
  const [height, setHeight] = useState("");
  const [sortBy, setSortBy] = useState("name");

  const Employees = ({ employees, loading, error, getEmployees }) => {
    useEffect(() => {
      getEmployees();
    }, [getEmployees]);

    if (loading) {
      return <div>Loading...</div>;
    }

    if (error) {
      return <div>Error: {error}</div>;
    }

    const filteredUsers = employee
      .sort((a, b) => {
        if (sortBy === "firstName") {
          return a.firstName.localeCompare(b.firstName);
        } else if (sortBy === "birthday") {
          return a.birthday - b.birthday;
        } else if (sortBy === "lastName") {
          return a.lastName.localeCompare(b.lastName);
        } else if (sortBy === "height") {
          return a.height - b.height;
        } else {
          return 0;
        }
      })
      .filter((employee) => {
        const firstNameMatch = employee.firstName
          .toLowerCase()
          .includes(firstName.toLowerCase());
        const secondNameMatch = employee.lastName
          .toLowerCase()
          .includes(lastName.toLowerCase());
        const birthdayMatch = birthday
          ? employee.birthday === parseInt(birthday)
          : true;
        const employeeIdMatch = employee.Id === employeeId || employeeId === "";
        const heightMatch = height
          ? employee.height === parseInt(height)
          : true;
        return (
          firstNameMatch &&
          secondNameMatch &&
          birthdayMatch &&
          employeeIdMatch &&
          heightMatch
        );
      });

    return (
      <div>
        <div>
          <label htmlFor="name-filter">Имя:</label>
          <input
            type="text"
            id="firstName-filter"
            placeholder="Фильтр по имени"
            value={firstName}
            onChange={(e) => setFirstName(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="lastName-filter">Фамилия:</label>
          <input
            type="text"
            id="lastName-filter"
            placeholder="Фильтр по фамилии"
            value={lastName}
            onChange={(e) => setLastName(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="birthday-filter">Возраст:</label>
          <input
            type="number"
            id="birthday-filter"
            placeholder="Фильтр по возрасту"
            value={birthday}
            onChange={(e) => setBirthday(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="height-filter">Рост:</label>
          <input
            type="number"
            id="height-filter"
            placeholder="Фильтр по росту"
            value={height}
            onChange={(e) => setHeight(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="sort-by">Сортировать по:</label>
          <select
            id="sort-by"
            value={sortBy}
            onChange={(e) => setSortBy(e.target.value)}
          >
            <option value="firstName">Имени</option>
            <option value="lastName">Фамилии</option>
            <option value="birthday">Возрасту</option>
            <option value="height">Росту</option>
          </select>
        </div>
        <h1>Список сотрудников</h1>
        <ul>
          {employees.map((employee) => (
            <li key={employee.id}>
              ID: {employee.employeeId} <br />
              Имя: {employee.firstName}
              <br />
              Фамилия: {employee.lastName}
              <br />
              День рождения: {employee.birthday}
              <br />
              Рост: {employee.height}
              <br />
              <button>Удалить</button>
              <br />
              <button>Редактировать</button>
            </li>
          ))}
        </ul>
      </div>
    );
  };

  const mapStateToProps = (state) => ({
    employees: state.employees.employees,
    loading: state.employees.loading,
    error: state.employees.error,
  });
}

export default connect(mapStateToProps, { getEmployees })(Employees);
